module Day5 where

import Data.Char (toUpper)
import Data.List (nub, sort, sortOn)

answer1 :: IO()
answer1 = print $ rlen ds

rlen :: String -> Int
rlen = length . react

react :: String -> String
react xs = if ys == xs then xs else react ys
  where
    ys = reactOnce xs

reactOnce :: String -> String
reactOnce []       = []
reactOnce [x]      = [x]
reactOnce (x:y:xs) = if (toUpper x == toUpper y) && (x /= y)
                     then reactOnce xs
                     else x : reactOnce (y:xs)


answer2 :: IO()
answer2 = print $ head $ sortOn snd lengths

lengths :: [(Char, Int)]
lengths = map (\c -> (c, rlen $ removeChar c ds)) letters

removeChar :: Char -> String -> String
removeChar c = filter (\x -> toUpper x /= c)

letters :: String
letters = nub $ sort $ map toUpper ds

ds :: String
ds = ds1

ds2 :: String
ds2 = "dabAcCaCBAcCcaDA"

ds1 :: String
ds1 = ""
